    "\n",
    "import mysql.connector\n",
    "import matplotlib.pyplot as plt\n",
    "import os\n",
    "\n",
    "# Create the Visualizations folder if it doesn't exist\n",
    "if not os.path.exists('Visualizations'):\n",
    "    os.makedirs('Visualizations')\n",
    "\n",
    "# Connect to the MySQL database\n",
    "conn = mysql.connector.connect(\n",
    "    host=\"localhost\",\n",
    "    user=\"super\",\n",
    "    password=\"super123\",\n",
    "    database=\"salesss_db\"\n",
    ")\n",
    "cursor = conn.cursor()\n",
    "\n",
    "# 1. Total Sales Per Product\n",
    "query_product_sales = \"\"\"\n",
    "SELECT product, SUM(quantity * price) AS total_sales\n",
    "FROM saless\n",
    "GROUP BY product\n",
    "ORDER BY total_sales DESC;\n",
    "\"\"\"\n",
    "cursor.execute(query_product_sales)\n",
    "product_results = cursor.fetchall()\n",
    "products = [row[0] for row in product_results]\n",
    "product_sales = [row[1] for row in product_results]\n",
    "\n",
    "plt.figure(figsize=(10, 6))\n",
    "plt.bar(products, product_sales, color='blue')\n",
    "plt.xlabel('Product')\n",
    "plt.ylabel('Total Sales')\n",
    "plt.title('Total Sales Per Product')\n",
    "plt.xticks(rotation=45)\n",
    "plt.tight_layout()\n",
    "plt.savefig('Visualizations/total_sales_per_product.png')\n",
    "plt.show()\n",
    "\n",
    "# 2. Top Customers by Spending\n",
    "query_top_customers = \"\"\"\n",
    "SELECT customer_id, SUM(quantity * price) AS total_spending\n",
    "FROM saless\n",
    "GROUP BY customer_id\n",
    "ORDER BY total_spending DESC;\n",
    "\"\"\"\n",
    "cursor.execute(query_top_customers)\n",
    "customer_results = cursor.fetchall()\n",
    "customers = [f\"Customer {row[0]}\" for row in customer_results]\n",
    "customer_spending = [row[1] for row in customer_results]\n",
    "\n",
    "plt.figure(figsize=(10, 6))\n",
    "plt.bar(customers, customer_spending, color='green')\n",
    "plt.xlabel('Customer')\n",
    "plt.ylabel('Total Spending')\n",
    "plt.title('Top Customers by Spending')\n",
    "plt.xticks(rotation=45)\n",
    "plt.tight_layout()\n",
    "plt.savefig('Visualizations/top_customers_spending.png')\n",
    "plt.show()\n",
    "\n",
